import React from 'react';
import './contact.css';
import Marquee from 'react-fast-marquee';
import SideMenu from './SideMenu';

const Contact = () => {
  return (
    <div className="contact-page">
      {/* Overlay Marquee */}
      <div className="marquee-overlay">
        <marquee behavior="slide" direction="left" scrollamount="">
          <h1>Welcome to SkyTrack Airport Directory - Contact Us for Support</h1>
        </marquee>
      </div>

      {/* Contact Content */}
      <div className="contact-container">
        <marquee behavior="scroll" direction="left" scrollamount="10"><h2>Contact Us</h2></marquee>
        <h3>Address</h3>
        <p>
          Thiruvananthapuram International Airport <br />
          Airport Rd, Chackai <br />
          Thiruvananthapuram, Kerala PIN-695024
        </p>
        <p>If you have any queries, feel free to reach out to us:</p>
        <p>
          Email: <a href="mailto:feedback@flightapptvm.com">feedback@flightapptvm.com</a>
        </p>
        <p>
          Contact Number <br />
          Domestic: 0471-2702311 <br />
          International: +1-800-555-5555
        </p>
      </div>
      <SideMenu/>
    </div>
  );
};

export default Contact;
